import React from "react";

export const Tile = (props) => {
  return (
    <div className="tile-container">
      <div>
        <h3 className="">{props.info.name}</h3>
        <p>{props.info.email}</p>
        <p>{props.info.phone}</p>
      </div>
    </div>
  );
};
